INSERT INTO `messageboard` VALUES (23, '匿名', '2020-12-21 13:10:42', '傲来雾，花果香，定海一棒万妖朝。\n‌东海外，水帘中，齐天比高仙折腰。素衣着，泪情诗，待你未归人潮逝。\n‌初相识，唇上血，千古第一为红颜。\n‌破阳炎，地寒天，泪中再见忆中颜。\n‌玉璧传，金铃现，血染涂山为君颜。\n‌伊人泪，蛊灵愿，我命由我不由天。\n‌清瞳月，兵人剑，相视一笑轻王权。\n‌再相逢，命燃枝，不枉树下来世愿。\n‌将欲死，情莫逝，树下情请再来世。\n‌再相逢，不相认，一点缘孽如浮生。\n‌御水珠，三生情，十里红妆女儿愿。\n‌寒冰戈，忆如沙，一语清辞胜千言。\n‌灭妖火，点情愿，五十年愿终实现。\n‌五彩棒，续前缘，五百年缘终相见。\n‌着囚衣，南国宫，欢度公主痴念中。\n‌相思浓，百年空，奈何涂山一抹红。\n易千颜，情不改，若忘此生来世忆。\n雨落心，寻君影，身化青松仍相识。\n战沙场，情未了，一朝称帝千古传。\n魍魉计，望月心，千颜铁掌化曾经。');
