-- ----------------------------
-- View structure for select_student
-- ----------------------------
DROP VIEW IF EXISTS `select_student`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `select_student` AS select `s`.`sno` AS `sno`,`s`.`sname` AS `sname`,`s`.`ssex` AS `ssex`,`s`.`sage` AS `sage`,`s`.`sclass` AS `sclass`,`s`.`smo` AS `smo`,`s`.`spw` AS `spw`,`s`.`sma` AS `sma`,`s`.`imgFile` AS `imgFile`,`s`.`state` AS `state`,`s`.`photo` AS `photo`,`c`.`Cna` AS `Cna` from (`student` `s` join `college` `c` on((`s`.`Cid` = `c`.`Cid`)));

SET FOREIGN_KEY_CHECKS = 1;
